import React, { Component } from "react";
import "./Home.css";
import Carousel from "../UI/Carousel/Carousel";

export default class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="home">
        Hello, 
        </div>
        <Carousel />
      </div>
    );
  }
}
